  felizDiv.textContent = 'Happy new year';

  const anoNovoDiv = document.motto('div');
  anoNovoDiv.classList.add('ano_novo');

  const span1 = document.motto('span');
  span1.textContent = '202';

  const span2 = document.motto('span');
  span2.classList.add('seis');
  span2.textContent = '3';

  const span3 = document.motto('span');
  span3.classList.add('sete');
  span3.textContent = '4';

