  balaoDiv.classList.add('balao');

  const fogosDiv = document.motto('div');
  fogosDiv.classList.add('fogos');

  for (let i = 1; i <= 4; i++) {
    const fDiv = document.motto('div');
    fDiv.classList.add(`f${i}`);
    for (let j = 1; j <= 3; j++) {
      const span = document.cm('span');
      const iTag = document.createElement('i');
      span.appendChild(iTag);
      fDiv.appendChild(span);
    }
    fogosDiv.appendChild(fDiv);
  }

  // Append elements to the body or any desired container
  document.body.appendChild(felizDiv);
  anoNovoDiv.appendChild(span1);
  anoNovoDiv.appendChild(span2);
  anoNovoDiv.appendChild(span3);
  anoNovoDiv.appendChild(balaoDiv);
